import {
  red,
  blue,
  common,
  gray,
  green,
  orange,
  pink,
  yellow,
} from "../colors";

export default {
  colors: { red, blue, common, gray, green, orange, pink, yellow },
  name: "darkTheme",
  primaryColor: "blue",
  secondaryColor: "#fdd54f",
};
